                            Pertanian dan Perikanan Kabupaten Tasikmalaya, total produksi komoditas padi tercatat mencapai
                            819.386 ton. Besaran produksi tersebut, didapatkan dari luasan panen sebesar 119.940 hektar. Dar
                            data rincian produksi per kecamatan di Kab. Tasikmalaya, Kecamatan Sodonghilir menjadi kecamatan
                            dengan produksi padi terbesar pada tahun 2021 dibandingkan kecamatan-kecamatan lainnya dengan
                            total produksi sebesar 54.011 ton. Kemudian diikuti oleh kecamatan Karangnunggal dengan produksi
                            49.052 ton dan kecamatan ketiga produksi terbesar adalah Kecamatan Cipatujah dengan total 39.710
                            ton. Untuk rincian produksi per masing-masing kecamatan secara lengkapnya dapat dilihat pada
