                        <p
                            style="font-size:16px;font-family:Bookman Old Style,serif; text-align:justify;margin-bottom:2%;margin-top:2%">
                            Selain data untuk produksi tanaman pangan (padi), Data produksi tanaman palawija juga menjadi
