                            tanaman palawija, komoditas ubi kayu menjadi komoditas dengan produksi terbesar pada tahun 2021
                            dengan angka 57.693 ton. Kemudian komoditas kedua adalah komoditas jagung dengan produksi
                            tercatat sebesar 35.699 ton. Untuk rincian data produksi tanaman palawija dapat dilihat pada
