                        <p
                            style="font-size:16px;font-family:Bookman Old Style,serif; text-align:justify;margin-top:2%;margin-bottom:2%">
                            Selanjutnya, pada laporan data dari Dinas Ketahanan Pangan, Pertanian dan Perikanan Kab.
                            Tasikmalaya, juga didapatkan data produksi komoditas sayuran. Kondisi data eksisting pada tahun
                            2021 dari 23 (dua puluh tiga) data komoditas sayuran telah dipilah oleh tim survei menjadi 9
                            (sembilan) komoditas pertanian dengan produksi terbesar di Kabupaten Tasikmalaya. Sembilan
                            komoditas tersebut diantaranya adalah Bawang Merah, Cabe Rawit, buncis, Cabe Besar, Tomat,
                            Terung, Mentimun, Kacang Panjang dan Jamur. Komoditas jamur menjadi komoditas palawija dengan
                            produksi terbesar, dengan volume yang tercatat pada tahun 2021 sebesar 21.945 ton. Kemudaian
                            diikuti oleh tomat yang menjadi komoditas palawija terbesar kedua dengan total produksi sebesar
                            3.487 ton. Dari data yang telah dihimpun, 9 komoditas palawija terbesar di Kabupaten Tasikmalaya
                            ini bisa menjadi salah satu potensi muatan di Pelabuhan Pangandaran untuk perdagangan antar
                            provinsi. Berikut data rincian dari 9 (sembilan) komoditas unggulan untuk sektor palawija di
                            Kabupaten Tasikmalaya yang dicatat per produksi masing-masing kecamatan.
                        </p>
