                        <p style="font-size:16px;font-family:Bookman Old Style,serif; text-align:justify;margin-top:2%">
                            Data terakhir yang di dapat dari Dinas Ketahanan Pangan, Pertanian dan Perikanan adalah data produksi komoditas perikanan. Dalam tabel di bawah ini total produksi komoditas perikanan di Kabupaten Tasikmalaya tercatata sebesar 56.885 ton pada tahun 2021 dengan total nilai komoditas sebesar 1,6 Triliun Rupiah. Terdapat 5 (lima) komoditas perikanan unggulan yang tercatat dalam tabel dibawah ni yaitu ikan gurame, ikan lele, ikan nila, ikan mas, dan udang. Apabila dilihat dari besaran volume Komoditas Ikan Nila menjadi komoditas terbesar dengan total produksi sebesar 29.177 ton. Sementara apabila dilihat dari nilai komoditas, udang menjadi komoditas dengan total nilai komoditas terbesar denngan 728 Miliar Rupiah. Kesimpulan lain yang dapat diambil adalah, Kecamatan Cipatujah menjadi penyuplai komoditas perikanan terbesar dengan total volume tahunan adalah 6.310 ton. Selanjutnya diikuti oleh kecamatan Cikalong dengan volume tahunan sebesar 5.620 ton dan kecamatan Cigalontang dengan volume tahunan sebesar 5.357 ton. Untuk detail data produksi volume komoditas unggulan perikanan di Kabupaten Tasikmalaya per masing-masing kecamatan dapat dilihat pada tabel dibawah ini.  
